        {% block javascripts %}

        {% endblock %}
    </head>

    <body>
        <header class=\"header\">
            {% block header %}
                <nav class=\"nav\">
                    <label class=\"label\">NOM</label>
                    <ul>
                        {% if not app.user %}
                            <li class=\"nav-item\">
                                <a href=\"{{ path('security_login') }}\" class=\"nav-link\">Connexion</a>
                            </li>
                        {% else %}
                            <li class=\"nav-item\">
                                <a href=\"{{ path('security_logout') }}\" class=\"nav-link\">Déconnexion</a>
                            </li>
                        {% endif %}
                        <li><a href=\"{{ path('security_registration') }}\">Inscripion</a></li>
                    </ul>
                </nav>
            {% endblock %}
        </header>
        <div class=\"vue\">
            {% block body %}
                <h1>
                    {% block titre_principal %}

                    {% endblock %}
                </h1>
                {% block vue %}

                {% endblock %}
            {% endblock %}
        </div>
        <footer class=\"footer\">
            {% block footer %}

            {% endblock %}

        </footer>
    </body>
</html>
